description:
For days now, our hearts have been gripped by the horrible war situation that is ravaging Ukraine and its people. Families are being divided and forced to flee, leaving everything to seek safety, and those who remain have to fight to defend their homes if they can. ... üòî
This situation makes us feel helpless because we are faced with something bigger than all of us.
It is something that concerns everyone, so I and 12 other splendid artists have decided to organize a fundraiser during the next 10 days. 
Everything will be donated entirely to the "Childrens Voice's" association @voices_of_children . This association provides psychological and social assistance for children in war situations ‚ù§Ô∏è‚Äç and of course, we will keep you updated throughout the fundraising campaignüå∏

